import axios from 'axios';

function Userportalpage() {
    axios.get('http://127.0.0.1:8000/myapp/auth')
      .then(res => {
        const persons = res.data;
        this.setState({ persons });
      })
    return (
      <div>
        <h1>Hello man</h1>
      </div>
    );
  }
  
  export default Userportalpage;
